import React from "react";
import { BrowserRouter, Route, Link, Switch } from "react-router-dom";
// import { render } from "react-dom";

// separate route files being imported
import { pageOne } from "./one";
import { pageTwo } from "./two";
import { pageThree } from "./three";
import { pageFour } from "./four";

import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <div className='App'>
        <p>Hola Bienvendidios!! Welcome to my React-Router!</p>
      </div>
      <ul>
        <li>
          <Link to='/one'>Page One</Link>
        </li>
        <li>
          <Link to='/two'>Page Two</Link>
        </li>
        <li>
          <Link to='/three'>Page Three</Link>
        </li>
        <li>
          <Link to='/four'>Page Four</Link>
        </li>
      </ul>

      <Switch>
        <Route path='/one' component={One} />
        <Route path='/two' component={Two} />
        <Route path='/three' component={Three} />
        <Route path='/four' component={Four} />
      </Switch>
    </BrowserRouter>
  );
}
export default App;
